/* eslint-disable jsx-a11y/img-redundant-alt */
import React from "react";
import styles from './dogCard.module.css';

const DogCard = ({
    name,
    imagen,
    temperament,
    weight
  }) => {
    return(
        <div className={styles.containerCard}>
            <h2>{name}</h2>
            <img src={imagen} alt="Dog Image"></img>
            <h2>{temperament}</h2>
            <h2>{weight}</h2>
        </div>
    );
}

export default DogCard;
